import React from 'react';


function App() {
  return (
    <div className="App">
      <div className="header">
        Podcast Ideas
      </div>
      <div className="content">
        <div className="square">
          <h1 style={{
            textAlign:"center"
          }}>Hello</h1>
        </div>
      </div>
      <div className="footer">
        <button style={{
          height:"100%",
          background:"none",
          border:"none",
          padding:"0",
          fontSize:"25px",
          margin: "10px"
        }}>Next ></button>
      </div>


    </div>
  );
}

export default App;
